import React, { Component, useState } from 'react';
import logo from './logo.svg';
import './App.css';
import Papa from 'papaparse';




function Example() {
  const [parsedCsvData, setParsedCsvData] = useState([]);
  //const parseFile = file => {
    Papa.parse('https://docs.google.com/spreadsheets/d/e/2PACX-1vRUvD-Cab6I3vItJ3w1MNEiMM3L8wuJwre1hjE1WxNGERsi84ZdEkK1ZWcXaPaKPcrK2viV-aOSlAcg/pub?output=csv', {
      header: true,
      download: true,
      complete: results => {
        setParsedCsvData(results.data)

      },
    });
  //}; 

  console.log('hej', parsedCsvData)
}






class App extends Component {
  constructor() {
    super()
    this.state = {
      data: []
    }
  }

  componentDidMount() {
    function init() {
      Papa.parse('https://docs.google.com/spreadsheets/d/e/2PACX-1vRUvD-Cab6I3vItJ3w1MNEiMM3L8wuJwre1hjE1WxNGERsi84ZdEkK1ZWcXaPaKPcrK2viV-aOSlAcg/pub?output=csv', {
        download: true,
        header: true,
        complete: function(results) {
          var data = results.data
          console.log(data)

        }
      })
    }

  }

  render() {
    // console.log('updated state --->', this.state)
    console.log('hej', parsedCsvData)
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <h1 className="App-title">React + Google Sheets Demo</h1>
        </header>
      </div>
    );
  }
}

export default App;
